import React from "react"

const WorkItem = ({year, title, duration, details}) => {
    return (
        <ul class="workitem">
            <li class="item">
                <p class="work">
                    <span class="tag">{year}</span>
                    <span>{title}</span>
                    <span>{duration}</span>
                </p>
                <p>{details}</p>
            </li>
        </ul>
    );
};

export default WorkItem;

